parts.text:
০১। সচিব, মাধ্যমিক ও উচ্চ শিক্ষা বিভাগ, শিক্ষা মন্ত্রণালয়, বাংলাদেশ সচিবালয়, ঢাকা;
০২। চেয়ারম্যান, জাতীয় শিক্ষাক্রম ও পাঠ্যপুস্তক বোর্ড, ঢাকা;
০৩। চেয়ারম্যান, মাধ্যমিক ও উচ্চ মাধ্যমিক শিক্ষা বোর্ড, ঢাকা;
০৪। মাননীয় মন্ত্রীর একান্ত সচিব, মন্ত্রীর দপ্তর, মাধ্যমিক ও উচ্চ শিক্ষা বিভাগ, শিক্ষা মন্ত্রণালয়, ঢাকা;
০৫। মাননীয় উপমন্ত্রীর একান্ত সচিব, উপমন্ত্রীর দপ্তর, মাধ্যমিক ও উচ্চ শিক্ষা বিভাগ, শিক্ষা মন্ত্রণালয়, ঢাকা;
০৬। পরিচালক (কলেজ ও প্রশাসন/মাধ্যমিক/পরি: ও উনঃ/প্রশিক্ষণ/অর্থ ও ক্রয়/মনি: এন্ড ইভা:), মাধ্যমিক ও
উচ্চ শিক্ষা অধিদপ্তর, বাংলাদেশ, ঢাকা;
০৭। চেয়ারম্যান, মাধ্যমিক ও উচ্চ মাধ্যমিক শিক্ষা বোর্ড (সকল);
০৮। পরিচালক, মাধ্যমিক ও উচ্চ শিক্ষা, (সকল অঞ্চল);
০৯। সিনিয়র সিস্টেম এনালিস্ট, এমআইএস সেল, মাধ্যমিক ও উচ্চ শিক্ষা অধিদপ্তর, বাংলাদেশ, ঢাকা
(পত্রটি মাউশি অধিদপ্তরের ওয়েব সাইটে প্রকাশের অনুরোধসহ);
১০। পি এ টু মহাপরিচালক, মাধ্যমিক ও উচ্চ শিক্ষা অধিদপ্তর, বাংলাদেশ, ঢাকা।
১১। সংরক্ষণ নথি।
